import React, { useState } from "react";
import "./Navbar.css";

const Navbar = () => {
  const [query, setQuery] = useState("");

  const handleSearch = (e) => {
    e.preventDefault();
    console.log("Searching for:", query);
  };

  return (
    <nav className="custom-navbar">
      <div className="container d-flex align-items-center justify-content-between">
        {/* Logo */}
        <a href="/" className="brand">
          üöó CarHub
        </a>

        {/* Links */}
        <ul className="nav-links d-none d-md-flex">
          <li><a href="/">Home</a></li>
          <li><a href="/cars">Cars</a></li>
          <li><a href="/about">About</a></li>
          <li><a href="/contact">Contact</a></li>
        </ul>

        {/* Search */}
        <form className="search-bar d-none d-md-flex" onSubmit={handleSearch}>
          <input
            type="text"
            placeholder="Search cars..."
            value={query}
            onChange={(e) => setQuery(e.target.value)}
          />
          <button type="submit">üîç</button>
        </form>

        {/* Mobile Menu Button */}
        <button
          className="menu-toggle d-md-none"
          data-bs-toggle="collapse"
          data-bs-target="#mobileMenu"
        >
          ‚ò∞
        </button>
      </div>

      {/* Mobile Menu */}
      <div className="collapse" id="mobileMenu">
        <ul className="mobile-links">
          <li><a href="/">Home</a></li>
          <li><a href="/cars">Cars</a></li>
          <li><a href="/about">About</a></li>
          <li><a href="/contact">Contact</a></li>
          <li>
            <form className="search-bar-mobile" onSubmit={handleSearch}>
              <input
                type="text"
                placeholder="Search cars..."
                value={query}
                onChange={(e) => setQuery(e.target.value)}
              />
              <button type="submit">üîç</button>
            </form>
          </li>
        </ul>
      </div>
    </nav>
  );
};

export default Navbar;
